	this.shape_1.setTransform(125.1,200);

	this.shape_2 = new cjs.Shape();
	this.shape_2.graphics.f("#FFFFFF").s().p("EgXvAiiMAAAhFDMAvfAAAMAAABFDgAzh9yMAAAA7RQAABTBWAAMAjwAAAQBVAAAAhTMAAAg7RQAAhThVAAMgjwAAAQhWAAAABTg");
	this.shape_2.setTransform(127,201);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.shape_2},{t:this.shape_1}]}).wait(1));

